import Aos from "aos";
import React, { useEffect } from "react";

function About() {
  useEffect(() => {
    Aos.init();
  }, []);
  return (
    <div
      id="aboutUs"
      className="container d-flex flex-row justify-content-center justify-content-md-start align-items-between w-100 h-100"
    >
      <div className="row w-100">
        <div className="col-12 col-md-6">
          <h2 className="text-white display-1 font-weight-bold">About Me</h2>
        </div>
      </div>
    </div>
  );
}

export default About;
